window.bookSummaryJSON = "<p><b>Savagery. Sin. Depravity - these are my virtues. My religion. </b></p> <p>My name is Dante Sovrano, head of the Chicago Mob, and I run this city. Everyone bows down to me. Except her. </p> <p>The moment I saw Sarah, I knew she'd be trouble. She's fiery and cutthroat, wrapped up in a lickable package. </p> <p>There are dark secrets hiding behind those gorgeous blue eyes. And I plan to know them all. </p> <p>She'll have to make a deal with the devil to solve her problems. </p> <p>Too bad the devil always takes your soul. And I'll be keeping it - because Sarah London is mine. </p> <p><b>Contains mature themes.</b></p>"; 
